import React from 'react';
import Container from '@mui/material/Container';
import Header from '../components/header'
import '../styles/home.css';

const Home = () => {
  return (
    <div className="home">
        <Container sx={{ width: '100%', maxWidth: '100%' }} className="head">
            <Header />
        </Container>
    </div>
  );
};

export default Home;
